con:config.script:
import nhinc.FileUtils;
def dir = context.findProperty('GatewayPropDir');
def file = "gateway.properties";
def passthruProp = "docsubmission.inboundDocSubmission";

def passthruValue = FileUtils.readProperty(dir, file, passthruProp, log);
log.info "Passthrough property value = ${passthruValue}";

if(passthruValue != null){
	testRunner.testCase.setPropertyValue("PassThruOn", "true");
	FileUtils.backupFile(dir, "PolicyEngineProxyConfig.xml", log);
	//Updating PolicyEngine for passthrough
	def alias = 'adapterpolicyengineorchestrator';
	def aliasName = 'adapterpolicyengineorchestratorsamljava';
	def replaceName = 'adapterpolicyengineorchestratornoopdeny';

	FileUtils.updateSpringConfig(dir, "PolicyEngineProxyConfig.xml", alias,
		aliasName, replaceName, log);
} else {
	testRunner.testCase.setPropertyValue("PassThruOn", "false");
}

log.info "Setting Doc submission Adapter to unsecured";
def dir = context.findProperty('GatewayPropDir');
nhinc.FileUtils.backupFile(dir, "DocumentSubmissionProxyConfig.xml", log);
def alias = 'adapterdocsubmission' 
def aliasName= 'adapterdocsubmissionwssecured';
def replaceAlias = 'adapterdocsubmissionwsunsecured';

nhinc.FileUtils.updateSpringConfig(dir, "DocumentSubmissionProxyConfig.xml",
	alias, aliasName, replaceAlias, log);

log.info "Modifying internalExchangeInfo for adapter doc submission mock."

nhinc.FileUtils.createOrUpdateConnection("internalExchangeInfo.xml", dir, "1.1",
	"adapterxdr", "http://localhost:1720/MockDSAdapter", "2.0",
	log);

testRunner.testCase.testSuite.project.setPropertyValue("TransactionTimeoutValue", "15000" );
log.info "DS Timeout Ready To Wait For: " + testRunner.testCase.testSuite.project.getPropertyValue("TransactionTimeoutValue") + "ms"
def startDateTime = new Date().format("yyyy-MM-dd HH:mm:ss");
testRunner.testCase.setPropertyValue("RequestStartTime",startDateTime);

import groovy.time.*
def requestStartTime = testRunner.testCase.getPropertyValue("RequestStartTime");
log.info "DS Request Start Time: " + requestStartTime
def responseEndTime = new Date();
log.info "DS Response End Time: " + responseEndTime.format("yyyy-MM-dd HH:mm:ss");
def date = new Date().parse('yyyy-MM-dd HH:mm:ss',requestStartTime);
TimeDuration duration = TimeCategory.minus(responseEndTime, date);
log.info "DS Transaction Timedout Duration:  " + duration

if(!testRunner.testCase.testSuite.project.getPropertyValue("TransactionTimeoutValue").isEmpty()){
	testRunner.testCase.testSuite.project.setPropertyValue("TransactionTimeoutValue","");
}

